begin
  Qry := DM.NewQuery;
  try
    Qry.SQL.Text := ' select count(*) as c from   @nametable ';
    Qry.Open();
    if Qry['c'] <> NULL then
      Result := Qry['c']
    else
      Result := 0;
  finally
    Qry.Free;
  end;

